import React, { memo, forwardRef } from 'react';
const Icon = forwardRef(({ size = '1rem' }, ref) => {
  return (
    <>
      {React.Children.map(children, (child) => {
        return React.cloneElement(child, {
          ref,
          'data-testid': 'testId',
          style: memoStyle,
          width: size,
          height: size,
          className: 'aa',
          preserveAspectRatio: 'none',
          version: '1.1',
        });
      })}
    </>
  );
});

export default memo(Icon);
